import React, { Component } from 'react';
import './App.scss';
import Videos from './Videos/Videos';
import Sidebar from './Sidebar/Sidebar';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="Header">
          Header
        </header>
        <section className="Content">
          <Sidebar></Sidebar>
          <Videos></Videos>
        </section>
      </div>
    );
  }
}

export default App;
